function App() {
  let name = 'Hello world';
  console.log('App');
  // return (
  return (
    <div>
      <div className="App">
        <header className="App-header">
          {name}
        </header>
      </div>
    </div>
  );
}

function Demo() {
  console.log('Demo');
  return (
    <div className="App">
      <header className="App-header">
        Demo componant
      </header>
    </div>
  );
}

